     & * (h4b - 1 + noab * (h6b - 1 + noab * (h5b - 1)))))))
      END IF
      IF ((h6b .le. h4b) .and. (p2b .le. p1b) .and. (p1b .le. p3b)) THEN
      CALL TCE_SORT_6(dbl_mb(k_c_sort),dbl_mb(k_c),int_mb(k_range+p3b-1)
