     &k_sym+h6b-1),ieor(int_mb(k_sym+h15b-1),ieor(int_mb(k_sym+p1b-1),in
     &t_mb(k_sym+p7b-1)))))) .eq. ieor(irrep_y,irrep_t)) THEN
