     &)+int_mb(k_spin+h6b-1)+int_mb(k_spin+h15b-1)+int_mb(k_spin+p1b-1)+
     &int_mb(k_spin+p7b-1).ne.12)) THEN
      length = length + 1
      END IF
      END IF
      END IF
      END IF
